import logo from './logo.svg';
import './App.css';
import DiscreteSlider from './slider';
import VerticalSlider from './verticalSlider';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <DiscreteSlider></DiscreteSlider>
        <VerticalSlider></VerticalSlider>
      </header>
    </div>
  );
}

export default App;
